"""
为了使用SAM（Segment Anything Model, SAM）-ViT模型对提供的脑部MRI图像进行分割，我们需要提供一段描述性的文本提示，该提示应清晰地指示模型需要分割的具体区域或特征。以下是一个适用于SAM-ViT模型的图像分割词描述示例：

---

### 图像分割词描述

**目标：** 分割脑部肿瘤及其相关区域。

1. **整体脑部结构：**
   - "请分割整个大脑区域，包括左右半球和中央的脑室系统。"
   - "识别并分割出大脑皮层、白质和灰质区域。"

2. **肿瘤核心（ET, Enhancing Tumor）：**
   - "请定位并分割出增强肿瘤区域（ET），这是图像中对比度最高的部分，通常表现为明亮的区域。"
   - "分割出所有显示高信号强度且有明显边界的肿瘤核心区域。"

3. **非增强肿瘤（NET, Non-enhancing Tumor）：**
   - "识别并分割非增强肿瘤区域（NET），这些区域在图像中表现为中等信号强度，围绕在肿瘤核心周围。"
   - "请分割出与肿瘤核心相邻但信号强度较低的区域。"

4. **水肿区域（ED, Edema）：**
   - "请分割出脑水肿区域（ED），这些区域在图像中表现为低信号强度，通常位于肿瘤周围的广泛区域。"
   - "识别并分割出信号强度较低且边界较为模糊的水肿区域。"

5. **关键解剖结构：**
   - "请分割出脑室系统，包括侧脑室和第三脑室。"
   - "识别并分割出重要的脑沟和脑回，如中央沟、 Sylvian 裂等。"

6. **背景和正常组织：**
   - "请区分并分割出背景区域，即非脑组织部分。"
   - "分割出正常的脑组织区域，排除肿瘤和水肿的影响。"

### 示例文本提示

"请分割整个大脑区域，包括左右半球和中央的脑室系统。特别关注增强肿瘤区域（ET），这是图像中对比度最高的明亮区域。同时，识别并分割非增强肿瘤区域（NET），这些区域在图像中表现为中等信号强度，围绕在肿瘤核心周围。此外，分割出脑水肿区域（ED），这些区域在图像中表现为低信号强度且边界较为模糊。最后，请分割出脑室系统、重要的脑沟和脑回，以及正常的脑组织区域，排除肿瘤和水肿的影响。"

---

### 注意事项

- **具体性：** 描述应尽可能具体，明确指出需要分割的区域特征（如信号强度、边界清晰度等）。
- **对比度：** 强调不同区域之间的对比度差异，帮助模型更好地识别和分割。
- **解剖结构：** 提及关键的解剖结构，有助于模型理解空间关系。

"""


def text_to_vector(text):
    # 调用Qwen文本嵌入接口
    resp = TextEmbedding.call(
        model="text-embedding-v1",  # 专用文本向量模型
        input=text
    )

    # 获取原始向量（默认1024维）
    raw_vector = np.array(resp.output['embeddings'][0]['embedding'])

    # 目标维度为 1 × 256 × 64，共 16384 维
    target_dim = 1 * 256 * 64

    if len(raw_vector) < target_dim:
        padded_vector = np.pad(raw_vector, (0, target_dim - len(raw_vector)), mode='constant')
    else:
        padded_vector = raw_vector[:target_dim]

    # 重塑为目标形状
    return padded_vector.reshape((1, 256, 64))




